import{o as e,c as a,d as n}from"./app.0b9a38dc.js";const l='{"title":"Vue项目Bug记录","description":"","frontmatter":{},"headers":[{"level":2,"title":"渲染问题","slug":"渲染问题"},{"level":2,"title":"Element-ui问题","slug":"element-ui问题"},{"level":3,"title":"输入框@keyup失效","slug":"输入框-keyup失效"},{"level":3,"title":"遮罩层档住内容层","slug":"遮罩层档住内容层"},{"level":2,"title":"Vue项目打包后页面刷新出现404错误","slug":"vue项目打包后页面刷新出现404错误"}],"relativePath":"src\\\\frontend\\\\Vue\\\\vue项目bug记录.md","lastUpdated":1612089669896}',t={},i=n('<h1 id="vue项目bug记录"><a class="header-anchor" href="#vue项目bug记录" aria-hidden="true">#</a> Vue项目Bug记录</h1><h2 id="渲染问题"><a class="header-anchor" href="#渲染问题" aria-hidden="true">#</a> 渲染问题</h2><ol><li>页面渲染会按照静态的数据，之后再渲染请求到的数据，要注意一下顺序的问题；</li><li>遇到问题使用debugger试试渲染顺序的问题；</li><li>如果遇到页面没有渲染，可以查看network数据有没有请求成功;</li><li>出现list undefined但是页面没有出现问题，是因为使用了下标取值时，还没有值的，给父元素加个v-if，判断数组的长度；</li><li>使用ui框架没有渲染出来：vue官方提示说过，在html文件不支持写自闭合标签，因此如果没有渲染出来标签可能是写了自闭合标签；</li><li>在data数据里面引入图片不起作用的问题，需要在data函数里面require引入才行；</li></ol><h2 id="element-ui问题"><a class="header-anchor" href="#element-ui问题" aria-hidden="true">#</a> Element-ui问题</h2><h3 id="输入框-keyup失效"><a class="header-anchor" href="#输入框-keyup失效" aria-hidden="true">#</a> 输入框@keyup失效</h3><ul><li>加上.native转为原生的就可以解决了；<code>@keyup.enter.native=&#39;&#39;</code>；</li></ul><h3 id="遮罩层档住内容层"><a class="header-anchor" href="#遮罩层档住内容层" aria-hidden="true">#</a> <strong>遮罩层档住内容层</strong></h3><ul><li>在el-dialog标签里添加 <code>:modal-append-to-body=&#39;false&#39;</code></li></ul><h2 id="vue项目打包后页面刷新出现404错误"><a class="header-anchor" href="#vue项目打包后页面刷新出现404错误" aria-hidden="true">#</a> Vue项目打包后页面刷新出现404错误</h2><p>利用nginx配置一下location就可以了</p><div class="language-js"><pre><code>    # 配置<span class="token number">404</span>\n    location <span class="token operator">/</span>\n    <span class="token punctuation">{</span>\n        index index<span class="token punctuation">.</span>html index<span class="token punctuation">.</span>htm<span class="token punctuation">;</span>\n        try_files $uri $uri<span class="token operator">/</span> <span class="token operator">/</span>index<span class="token punctuation">.</span>html<span class="token punctuation">;</span>\n    <span class="token punctuation">}</span>\n</code></pre></div><ul><li><p>宝塔面板配置路径</p><p><img src="https://notecdn.heny.vip/images/vue%E9%A1%B9%E7%9B%AEbug%E8%AE%B0%E5%BD%95_01.png" alt="image-20200406221655304"></p></li></ul>',12);t.render=function(n,l,t,s,u,r){return e(),a("div",null,[i])};export default t;export{l as __pageData};
